import React from 'react';

const ProjectsLink = () => {
  return (
    <a
      className='f4 link dim grow no-underline mb3 mt3 dib black center'
      href='https://github.com/filippoferrando/repositories'
      target='_blank'
      rel='noopener noreferrer'
    >
      More Projects <i class='fas fa-arrow-circle-right' />
    </a>
  );
};

export default ProjectsLink;
